import React, { Component } from 'react'
import { connect } from 'react-redux'
import { Redirect, Link } from 'react-router-dom'

class UserDashboard extends Component {
    constructor(props) {
        super(props)

        this.state = {
            email: '',
            password: '',
            role: ''
        }
    }

    handleChange = (e) => {
        this.setState({
            [e.target.name]: e.target.value
        })
    }

    render() {
        return (
            <>
                <div className="container-fluid">
                    <div className='m-5'>
                        <nav className="navbar fixed-top navbar-dark p-3 shadow-lg rounded">
                            <div className='container'>
                                <Link to='/'><img src='/logo.png' alt='logo' className='float-left' style={{ width: '100px' }} /></Link>

                                <div className='float-left'>
                                    <Link to='/About'><span>About</span></Link>
                                    <Link to='/Products'><span>New Arrival</span></Link>
                                    <Link to='/Login'><span>Log In</span></Link>
                                    <Link to='/Signup'><span>Sign up</span></Link>
                                    <Link to='/Cart'><img src="/cart.png" alt='cart_icon' style={{ height: '40px' }} /></Link>
                                </div>

                            </div>
                        </nav>
                    </div>
                </div>
            </>
        )
    }
}
